const person = (vars) => {
	return (
		<div>
			<p>I'm {vars.name} and I am {vars.age} years old !</p>
			<p>{vars.children}</p>
		</div>
	);
	//return <p>I'm {vars.name} and I am {vars.age} years old !</p>;
}


export default person;
